import React from "react";
import "../src/css/result.css";
function Result() {
  const bs1 = {
    name: "BGMI",
    type: "SOLO",
    map: "ERANGLE",
    date: "01/01/2004",
    time: "10:00 am",
  };
  const bs2 = {
    name: "BGMI",
    type: "SOLO",
    map: "ERANGLE",
    date: "01/01/2004",
    time: "11:00 am",
  };
  const bsd = {
    name: "BGMI",
    type: "SQUAD",
    map: "ERANGLE",
    date: "01/01/2004",
    time: "12:00 am",
  };
  const fs1 = {
    name: "FREE FIRE",
    type: "SOLO",
    map: "BERMUDA",
    date: "01/01/2004",
    time: "10:00 am",
  };
  const fs2 = {
    name: "FREE FIRE",
    type: "SOLO",
    map: "BERMUDA",
    date: "01/01/2004",
    time: "11:00 am",
  };
  const fsd = {
    name: "FREE FIRE",
    type: "SQUAD",
    map: "BERMUDA",
    date: "01/01/2004",
    time: "12:00 am",
  };
  return (
    <div className="rmain">
      <div className="rbody">
        <div className="gtmdt">GAME : {bs1.name}</div>
        <div className="gtmdt">TYPE : {bs1.type}</div>
        <div className="gtmdt">MAP : {bs1.map}</div>
        <div className="gtmdt">MAP : {bs1.map}</div>
        <div className="gtmdt">DATE : {bs1.date}</div>
        <div className="gtmdt">TIME : {bs1.time}</div>
        <button>SHOW RESULT</button>
      </div>
    </div>
  );
}
export default Result;
